// Data
const planets = [
  {
    id: 1,
    name: '수성',
    url: 'data:image/jpeg;base64,',
  },
  {
    id: 2,
    name: '금성',
    url: 'data:image/jpeg;base64,',
  },
  {
    id: 3,
    name: '지구',
    url: 'data:image/jpeg;base64,',
  },
  {
    id: 4,
    name: '화성',
    url: 'data:image/jpeg;base64,',
  },
  {
    id: 5,
    name: '목성',
    url: 'data:image/jpeg;base64,',
  },
  {
    id: 6,
    name: '토성',
    url: 'data:image/jpeg;base64,',
  },
  {
    id: 7,
    name: '천왕성',
    url: 'data:image/jpeg;base64,',
  },
  {
    id: 8,
    name: '해왕성',
    url: 'data:image/jpeg;base64,',
  },
];

// getSearchResource
function getSearchResource(searchValue) {
  if (!searchValue) return false;
  return planets.filter(planet => planet.name === searchValue);
}

// create element
function createItem({ id, name, url }) {
  return `<div class="planet-item" id=planet_${id}>
    <div class="item-image">
      <img src=${url} />
         </div>
         <div class="item-name">
           <span>${name}</span>
         </div>
    </div>`;
}
// render list
function renderList(targetEl, dataList) {
  if (!dataList || dataList?.length < 1) return false;
  dataList.reverse().map(planet => {
    targetEl.insertAdjacentHTML('afterbegin', createItem(planet));
  });
}

window.addEventListener('load', e => {
  // getList
  const planetList = document.querySelector('.planet-list');
  renderList(planetList, planets);

  // search fucntion
  const form = document.querySelector('form');
  const onSubmit = e => {
    e.preventDefault();
    const items = document.querySelectorAll('.planet-item');
    items.forEach(item => item && planetList.removeChild(item));
    const searchName = form.search.value;
    const searchItem = getSearchResource(searchName);
    //  renderList
    if (Array.isArray(searchItem) && !searchItem.length) {
      const span = planetList.querySelector('span');
      span && planetList.removeChild(span);
      planetList.insertAdjacentHTML(
        'afterbegin',
        '<span class="error">찾으시는 내용이 없습니다. 😅</span>',
      );
      return;
    }
    if (!searchItem) {
      alert('행성 이름을 입력해주세요!');
      renderList(planetList, planets.reverse());
    } else {
      const span = planetList.querySelector('span');
      span && planetList.removeChild(span);
      renderList(planetList, searchItem);
    }
  };

  form.addEventListener('submit', onSubmit);
});
